import React from "react";
import { styled } from "@mui/material/styles";
import { APP_HEADER_HEIGHT } from "../../constants/app";
import autumnImage from "../../assets/autumn.jpg";
import springImage from "../../assets/spring.jpg";
import summerImage from "../../assets/summer.jpg";
import winterImage from "../../assets/winter.jpg";
import {
  Card,
  CardContent,
  CardHeader,
  CardMedia,
  Typography,
} from "@mui/material";

const HomeScreenEl = styled("div")(({ theme }) => ({
  height: `calc(100vh - ${APP_HEADER_HEIGHT}px)`,
  display: "flex",
  justifyContent: "center",
  alignItems: "center",
  flexDirection: "column",
  //   backgroundColor: console.log(theme),
}));

const HomeScreen = () => {
  return (
    <HomeScreenEl>
      <Card raised sx={{ mb: 4 }}>
        <CardHeader title="Get weather data" />
        <CardMedia
          component="img"
          height="240"
          image={springImage}
          alt="summer"
        />
      </Card>
      <Card sx={{ mb: 4 }}>
        <CardContent>
          <Typography variant="h3">By City name</Typography>
        </CardContent>
      </Card>
      <Card sx={{ mb: 4 }}>
        <CardContent>
          <Typography variant="h3">By Zip code (Only for USA)</Typography>
        </CardContent>
      </Card>
    </HomeScreenEl>
  );
};

export default HomeScreen;
